import React, { Component } from 'react';
import './Footer.css'

class Footer extends Component {
  render() {
    return (
      <div className="Footer">
        <p>Ashton Christensen - 2019 - <a href='https://github.com/Ashton-C'>
        <img  alt='' src='https://i.imgur.com/YOARux7.png' /></a></p>
      </div>
    );
  }
}

export default Footer;
